function dkSlideMenu(a){var r=document.querySelector(a);var q=r.querySelector("#panel");var c=null;r.onclick=function(e){var e=e||window.event;var b=e.target?e.target:e.srcElement;if(b){var d=b.parentNode.hash.substr(1);if(c)c.className="Off";c=document.getElementById(d);if(!c)return true;c.className="On";q.className="sOn"}return false};r.querySelector("#BB").onclick=function(e){if(c)c.className="Off";q.className="sOff"}};